import React from 'react'
import "./Reportpanel.css"
const Reportpanel=()=> {
    return (
        <div className="report">
            <h1 className="rephead"> Articles </h1>

           <iframe allowTransparency="true" className="report-css" width="100%" id="contactform123" name="contactform123" marginwidth="0" marginheight="0" frameborder="0" src="https://form.123formbuilder.com/5991889/form"><p>Your browser does not support iframes. The contact form cannot be displayed. Please use another contact method (phone, fax etc)</p></iframe>
        </div>
    )
}

export default Reportpanel
